import React from 'react';
import '../../App.css';

import PortfolioHead from '../PortfolioHead';
import PortfolioContent from '../PortfolioContent';
import Footer from '../Footer';


export default function Portfolio() {
  return (
  	<>
  		<PortfolioHead />
  		<PortfolioContent />
  		<Footer />
  	</>
  );
}
